import React from 'react';
import Navbar from './Navbar';
import Button from './Button';
import './ProductPage.css'; // Asegúrate de crear este archivo CSS

const ProductPage = () => {
  const menuItems = [
    { label: 'Inicio', path: '/' },
    { label: 'Productos', path: '/productos' },
    { label: 'Cuenta', path: '/cuenta' },
    { label: 'Acerca de', path: '/acerca-de' },
  ];

  return (
    <div className="product-page">
      <header className="product-page__header">
        {/* Aquí va tu logo y la barra de navegación */}
        <Navbar menuItems={menuItems} />
      </header>
      <section className="product-page__banner">
        {/* Aquí puedes poner los botones para registrar y eliminar productos */}
        <Button>Registrar producto</Button>
        <Button>Eliminar producto</Button>
      </section>
      {/* Aquí puedes poner el contenido principal de la página de productos */}
      <footer className="product-page__footer">
        {/* Aquí va tu pie de página */}
      </footer>
    </div>
  );
};

export default ProductPage;
